import React from 'react';
import {Wrap, Content, Title,Form,Message} from './style';



const contactPage =() =>{
    return(
        <Wrap>
            <Content>
                <Title>CONTACT ME</Title>
            <Form method="post" role="form">
                <Message>
                   <label>Firstname *</label> 
                </Message>
            </Form>
            </Content>
        </Wrap>
    )
}

export default contactPage;
